    [],nt"num_tags": 7,nt"name": "mark-twain-national-wildlife-refuge-brussels-district-annual-narrative-report-calendar-199",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for the Brussels
    District of Mark Twain National Wildlife Refuge summarizes Refuge activities during
    the 1996 calendar year.  Apple Creek WMA, Portage Island, the Calhoun Division,
    the Gilbert Lake Division, and the Batchtown Division are included.  The report
    begins with a summary of the yearu2019s highlights and climatic conditions.  Land
    acquisition is also covered.  The report includes a planning section which discusses
    the master plan, the management plan, public participation, compliance with environmental
    and cultural resource mandates, research, and investigations.  Refuge administration
    is outlined; information about personnel, youth programs, manpower programs, volunteer
    programs, funding, safety, and technical assistance is given.  Habitat management
    is also covered.  Subjects include wetlands, forests, croplands, grasslands, pest
    control, water rights, Farmers Home Administration Easements, and private lands.
     The wildlife section of the report discusses endangered species, threatened species,
    waterfowl, marsh birds, water birds, shorebirds, raptors, game mammals, and fisheries
    resources.  The public uses of the Refuge described in this report include outdoor
    classrooms, interpretive exhibits, fishing, trapping, wildlife observation, and
    law enforcement.  The equipment and facilities section of the report provides information
    about new construction, rehabilitation, major maintenance, equipment utilization/replacement,
    communication systems, computer systems, and energy conservation.  Cooperative programs
    are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
